import React from 'react';
import { observer } from 'mobx-react';
import cx from 'classnames';
import { Tooltip } from 'antd';
import { Labels } from '../../../common/icons';
import store from '../../store/RootStore';
import i18n from '../../locales';

const LabelMode = observer(() => (
  <Tooltip placement="bottom" title={i18n.translate('TOOLBAR_TIP_LABEL')}>
    <div
      className={cx('icon-button', {
        'icon-button--active': store.config.labelMode,
      })}
      onClick={() => store.config.setLabelMode(!store.config.labelMode)}
    >
      <Labels />
    </div>
  </Tooltip>
));

export default LabelMode;
